import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
const ExploreSearchComponent = () => {
  return (
    <div
      style={{
        justifyContent: 'center',
        justifyItems: 'center',
        display: 'flex',
      }}
    >
      <Card style={{width: '90%', margin: 20, borderRadius: 10}}>
        <Card.Header as="h5">
          {document.documentElement.offsetHeight}EXPLORE CANADA
        </Card.Header>
        <Form
          inline
          style={{
            paddingLeft: 20,
            paddingRight: 20,
            paddingTop: 10,
            paddingBottom: 10,
          }}
        >
          <Form.Row style={{width: '100%'}}>
            <Col lg={4}>
              <Form.Control
                type="text"
                placeholder="SEARCH BY CITY NAME"
                style={{width: '100%', marginTop: 10}}
              />
            </Col>
            <Col lg={6} style={{}}>
              <Form.Row
                controlId="formfGroupCheckIn"
                style={{
                  width: '100%',
                  marginTop: 10,
                }}
              >
                <Form.Label
                  style={{fontSize: 14, fontWeight: 'bold', width: '20%'}}
                >
                  Check In
                </Form.Label>
                <Form.Control
                  type="date"
                  placeholder="Start Date"
                  style={{width: '30%'}}
                />
                <Form.Label
                  style={{fontSize: 14, fontWeight: 'bold', width: '20%'}}
                >
                  Check Out
                </Form.Label>
                <Form.Control
                  type="date"
                  placeholder="End Date"
                  style={{width: '30%'}}
                />
              </Form.Row>
            </Col>

            <Col lg={2}>
              <Button style={{width: '100%', height: 38, marginTop: 10}}>
                Search
              </Button>
            </Col>
          </Form.Row>
        </Form>
      </Card>
    </div>
  );
};

export default ExploreSearchComponent;
